import React from 'react';
import './App.scss';
import Button from '@material-ui/core/Button';

const App = () => {
  return (
      <div>
        <h1>Hello Style!</h1>
        <p>Add a little style!.</p>
          <Button variant="contained" color="primary">
              Hello World
          </Button>
      </div>
  );
}

export default App;
